import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 3.2-2905 Virginia Agricultural Foundation Fund established.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-2905.md","filePath":"vacode/3.2-2905.md"}'),n={name:"vacode/3.2-2905.md"},i=t('<h1 id="§-3-2-2905-virginia-agricultural-foundation-fund-established" tabindex="-1">§ 3.2-2905 Virginia Agricultural Foundation Fund established. <a class="header-anchor" href="#§-3-2-2905-virginia-agricultural-foundation-fund-established" aria-label="Permalink to &quot;§ 3.2-2905 Virginia Agricultural Foundation Fund established.&quot;">​</a></h1><p>There is hereby established in the state treasury a special nonreverting fund to be designated as the Virginia Agricultural Foundation Fund, hereafter referred to as &quot;the Fund.&quot; The Fund shall be established on the books of the Comptroller. All transfers made to the Fund under §§ <a href="http://law.lis.virginia.gov/vacode/3.2-3617/" target="_blank" rel="noreferrer">3.2-3617</a>, <a href="http://law.lis.virginia.gov/vacode/3.2-3710/" target="_blank" rel="noreferrer">3.2-3710</a>, <a href="http://law.lis.virginia.gov/vacode/3.2-4004/" target="_blank" rel="noreferrer">3.2-4004</a>, <a href="http://law.lis.virginia.gov/vacode/3.2-4814/" target="_blank" rel="noreferrer">3.2-4814</a>, <a href="http://law.lis.virginia.gov/vacode/58.1-2259/" target="_blank" rel="noreferrer">58.1-2259</a>, and <a href="http://law.lis.virginia.gov/vacode/58.1-2289/" target="_blank" rel="noreferrer">58.1-2289</a>, other moneys appropriated thereto, gifts and grants, and interest accruing thereon shall be paid into the state treasury and credited to the Fund. Interest earned on moneys in the Fund shall remain in the Fund and be credited to it. Any moneys remaining in the Fund, including interest thereon, at the end of each fiscal year shall not revert to the general fund but shall remain in the Fund. The Fund shall be expended in accordance with the directions of the Agricultural Council and drawn from the state treasury in the manner provided by law.</p><p>Code 1950, § 3-16.9; 1966, c. 536, § 3.1-22.5; 1970, c. 457; 1976, c. 91; 1994, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0577" target="_blank" rel="noreferrer">577</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0649" target="_blank" rel="noreferrer">649</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0740" target="_blank" rel="noreferrer">740</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0743" target="_blank" rel="noreferrer">743</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>.</p>',3),l=[i];function o(d,s,h,g,c,u){return r(),a("div",null,l)}const p=e(n,[["render",o]]);export{_ as __pageData,p as default};
